import React, { Component } from 'react';
import cover from '../img/aboutuscover1.jpg';
import './aboutus.css';

class AboutUs extends Component {
    state = {  }
    render() { 
        return ( 
            <React.Fragment>
                <div className="container-fluid">
                    <div className="aboutus-body">
                        <div className="cover">
                            <img className="aboutus-cover-img" src={cover} alt=""/>
                        </div>
                        <div className="row justify-content-center text-center">
                            <div className="col-lg-4">
                                <h1>
                                    Lettuce
                                </h1>
                                <p>
                                Organic Agriculture is a production system that sustains the health of soils,
                                 ecosystems, and people. It relies on ecological processes,
                                  biodiversity and cycles adapted to local conditions,
                                   rather than the use of inputs with adverse effects. 
                                   Organic Agriculture combines tradition, innovation, 
                                   and science to benefit the shared environment and
                                    promote fair relationships and good quality of life 
                                    for all involved.
                                IFOAM General Assembly
                                2008
                                </p>
                            </div>
                        </div>
                    </div>
                </div>
            </React.Fragment>
         );
    }
}

export default AboutUs;
